import logo from './logo.svg';
import './App.css';
import React, {Component} from 'react';

class App extends Component{
  constructor(props){
    super(props);
    this.state = {
      items: [],
      isLoaded: false,

    }

  }
conponentDidMount(){
  var apiKey
  fetch('https://public-api.tracker.gg/v2/apex/standard/profile/{psn}/{Lil_Kha1998}')
    .then(res => res.json())
    .then(json =>{
      this.setState({
        isLoaded: true,
        items: json,
      })
    });
}
render(){

  var { isLoaded, items} = this.state;
  if(!isLoaded) {
    return <div>Loading...</div>;
  }else{

  return (
    <div className="App">
      <ul>
        {items.map(item => (
            <li key={item.id}>
              {item.name}
            </li>
        ))};
      </ul>

    </div>

  );
}
}
}
export default App;
